import Header from '../../components/Header/Header';
import HeroContainer from '../../components/HeroContainer/HeroContainer';
import ImageContainer from '../../components/ImageContainer/ImageContainer';
import BrandingContainer from '../../components/BrandingContainer/BrandingContainer';
import TrustedTechnologiesContainer from '../../components/TrustedTechnologiesContainer/TrustedTechnologiesContainer';
import ProjectsContainer from '../../components/ProjectsContainer/ProjectsContainer';
import ReviewsContainer from '../../components/ReviewContainer/ReviewsContainer';
import CTAContainer from '../../components/CTAContainer/CTAContainer';
import FooterForm from '..//../components/Footer/FooterForm';
import styles from '../Homepage/Desktop3.module.css';

const Desktop3 = () => {
    return (
        <div className={styles.desktop3}>
            <Header />
            <HeroContainer />
            <div className={styles.about}>
                <ImageContainer />
                <BrandingContainer />
                <div className={styles.title}>
                    <div className={styles.aPremierNew}>A premier New York-based design studio</div>
                    <div className={styles.text}>
                        <p className={styles.weFuelThe}>
                            We fuel the growth of purpose driven brands through strategy activation, design
                        </p>
                        <p className={styles.weFuelThe}>empowerment, and market adoption.</p>
                    </div>
                </div>
            </div>
            <TrustedTechnologiesContainer />
            <ProjectsContainer />
            <ReviewsContainer />
            <CTAContainer />
            <div className={styles.team13Parent}>
                <div className={styles.team13}>TEAM 13</div>
                <div className={styles.zmHizmetVe}>
                    Çözüm, hizmet ve ürünlerimiz hakkında detaylı bilgi için bizimle irtibata geçin.
                </div>
                <img className={styles.groupChild} alt="" src="/ellipse-5.svg" />
                <img className={styles.usersIcon} alt="" src="/users.svg" />
                <button className={styles.bizeUlanWrapper}>
                    <div className={styles.bizeUlan}>Bize Ulaşın</div>
                </button>
            </div>
            <FooterForm />
        </div>
    );
};

export default Desktop3;
